import React from "react";

class Form extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            nome: {
                value: "",
            },
            idade: {
                value: "",
            },
            genero: {
                value: "",
            }
        }
    }

    render() {
        return(
            <div>
                <form>
                    <label>Nome:</label>
                    <input type="text" name="nome" />

                    <label>Idade:</label>
                    <input type="number" name="idade" />

                    <label>Genero:</label>
                    <input type="text" name="genero" />
                </form>
            </div>
        )
    }
}

export default Form;
